import React from "react";

const Terminal = () => {
  return (
    <div className="terminal-container d-flex flex-column justify-content-center align-items-center">
      <h2>Terminal</h2>
      <p>Enter your commands here...</p>
    </div>
  );
};

export default Terminal;
